import React from 'react';
import "../App.css";
import "./Navigation.css";

function Navigation() {
    return (
        
        <div className="Navigation">
            <div className="leftSide">
                <h2>Menu</h2>
                </div>
            <div className="links">
                <button><a href="/MainCourse">MainCourse</a></button>&nbsp;&nbsp;
               <button> <a href="/ComboOffers">ComboOffers</a></button>&nbsp;&nbsp;
               <button> <a href="/Watermelon">Watermelon</a></button>&nbsp;&nbsp;
               <button> <a href="/Brownies">Brownies</a></button>
            </div>
  

            
           
            
        </div>
    )
}

export default Navigation
